import styled from "styled-components";

export const Header = styled.header`
  position: relative;
  top: 10px;
  background-color: rgba(26, 126, 207, 0.6);
  border-radius: 30px;
  padding: 0px;
  color: #fffff0;
  text-align: center;
`;

export const HomeNav = styled.nav`
  position: absolute;
  display: flex;
  flex-direction: column;
  top: 100%;
  left: 5%;
  gap: 50px;
  z-index: 10;
`;

export const HomeNavLink = styled.a`
  text-decoration: none;
  color: rgb(26, 126, 207);
  font-size: 25px;
  font-family: "Dosis", serif;

  &:hover {
    font-weight: bold;
    font-style: italic;
  }
`;

export const Main = styled.main`
  color: rgb(26, 126, 207);
  text-align: center;
`;

export const Portfolio = styled.div`
  font-size: 90px;
  position: relative;
  top: 170px;
`;

export const Name = styled.div`
  font-size: 35px;
  position: relative;
  top: 170px;
`;

export const Week = styled.div`
  position: relative;
  top: 100px;
  right: -45%;
  transform: rotate(90deg);
  font-size: 18px;
`;

export const Footer = styled.footer`
  position: fixed;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 150px;
`;

export const FooterImg = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;
